import React from "react";

const Logo = () => {
  return (
    <div className="flex items-center space-x-4">
      {/* Animated and Brightened Logo Icon */}
      <div className="relative w-12 h-12 flex items-center justify-center">
        <svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 24 24"
          className="w-12 h-12 animate-pulse"
        >
          <defs>
            {/* Vibrant Gradient */}
            <linearGradient id="bright-gradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#FF5C5C" />
              <stop offset="50%" stopColor="#FF8C42" />
              <stop offset="100%" stopColor="#FFC837" />
            </linearGradient>
          </defs>
          <path
            d="M12 21.35c-1.12-.92-6.6-5.3-8.6-8.1C2 10 2 7.8 2 6c0-3.1 2.3-5.4 5.4-5.4 1.5 0 2.9.8 3.8 2 1-.9 2.3-2 3.8-2 3.1 0 5.4 2.3 5.4 5.4 0 1.8 0 4-1.4 6.3-2 2.8-7.5 7.3-8.6 8.1z"
            fill="url(#bright-gradient)"
          />
        </svg>
      </div>

      {/* Enhanced Typography */}
      <div className="flex flex-col">
        <span
          className="text-3xl font-extrabold tracking-wide bg-clip-text text-transparent"
          style={{
            backgroundImage: "linear-gradient(90deg, #FF5C5C, #FF8C42, #FFC837)",
          }}
        >
          Nurse-Sync
        </span>
        <span className="text-sm font-medium text-slate-600">
          Elevating Healthcare Connections
        </span>
      </div>
    </div>
  );
};

export default Logo;
